			shellScript = "# Define the path to the GoogleService-Info.plist files for different configurations\n\nDEV_PLIST_PATH=\"${PROJECT_DIR}/CloudVsFire/Config/Firebase/Dev/GoogleService-Info.plist\"\nPROD_PLIST_PATH=\"${PROJECT_DIR}/CloudVsFire/Config/Firebase/Prod/GoogleService-Info.plist\"\n\n# Destination path for the GoogleService-Info.plist in the app's bundle\nDESTINATION_PLIST_PATH=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app/GoogleService-Info.plist\"\n\necho \"Current Configuration: ${CONFIGURATION}\"\necho \"Development plist path: ${DEV_PLIST_PATH}\"\necho \"Production plist path: ${PROD_PLIST_PATH}\"\necho \"Destination path: ${DESTINATION_PLIST_PATH}\"\n\n# Function to copy the plist file with error checking\ncopy_plist() {\n    src=$1\n    dest=$2\n\n    if [ -f \"$src\" ]; then\n        echo \"Copying plist from $src to $dest\"\n        cp \"$src\" \"$dest\"\n        if [ $? -ne 0 ]; then\n            echo \"Error: Failed to copy plist file.\"\n            exit 1\n        fi\n    else\n        echo \"Error: Source plist file does not exist at $src\"\n        exit 1\n    fi\n}\n\n# Determine which plist to use based on the configuration\nif [ \"${CONFIGURATION}\" == \"Debug\" ]; then\n    copy_plist \"${DEV_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\nelif [ \"${CONFIGURATION}\" == \"Release\" ]; then\n    copy_plist \"${PROD_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\nelse\n    echo \"Configuration not recognized, using Development GoogleService-Info.plist as default\"\n    copy_plist \"${DEV_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\nfi\n";
